// src/components/UserPage.js
import React from 'react';
import FlightList from './FlightList';

function UserPage() {
  return (
    <div>
      <h1>Welcome, User!</h1>
      <p>You can now book tickets.</p>
      <FlightList isLoggedIn={true} />
    </div>
  );
}

export default UserPage;
